import styled from 'styled-components';

const Container = styled.div`
  height:370px;
  width: 100vw;
  background: yellow;
  background-size: 100%;
  position: relative;
  overflow: hidden;
`;

const Logo = styled.div`
  height: 100vh;
  justify-content: center;
  display: flex;
`;

export {
  Container,
  Logo
}
